      name: "Inception",
      url: "data:image/jpeg;base64,",
      duration: "2h 28m",
      genre: "Sci-Fi/Thriller",
      about:
        " is a mind-bending sci-fi thriller that explores dreams within dreams. It follows Dom Cobb, a skilled thief who steals secrets from deep within the subconscious. Offered a chance to erase his criminal record, Cobb must pull off the seemingly impossible — planting an idea instead of stealing one. With stunning visuals and layered storytelling, the film challenges the boundaries between reality and illusion.",
